e=\'font-weight: normal\'>\\n\\t\\t\\t\\t<ul>\\n\\t\\t\\t\\t\\t<li style=\\\"padding:10px 0px 10px 20px;\\\">12+ block types: At this phase, we round up typical blocks that Uber has to offer. Each block type comes with multiple styles.<\\/li>\\n\\t\\t\\t\\t\\t<li style=\\\"padding:10px 0px 10px 20px;\\\">Easy editing & defining your page-specific field sets within each block. Each block has its own LESS file, so you have full control to define your own class and style.<\\/li>\\n\\t\\t\\t\\t\\t<li style=\\\"padding:10px 0px 10px 20px;\\\">Content-creator-friendly: completely separate content & design. No longer mixing HTML syntax embedded inside article.<\\/li>\\n\\t\\t\\t\\t\\t<li style=\\\"padding:10px 0px 10px 20px;\\\">Allow us to dig deeper into the modular block approach which eases our page management effort.<\\/li>\\n\\t\\t\\t\\t<\\/ul>\\n\\t\\t\\t<\\/div>\\n\\t\\t\\t<br \\/>\\n\\t\\t\\t\\n\\t\\t<\\/div>\\n\\t\\t\\n\\t\",\"group\":\"\",\"filename\":\"mod_ja_acm\"}','{\"jatools-config\":\"1\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"itemid\"}','',NULL,NULL,0,0,NULL),(235,0,'plg_system_jasocialshare','plugin','jasocialshare','','system',0,1,1,0,0,'{\"name\":\"plg_system_jasocialshare\",\"type\":\"plugin\",\"creationDate\":\"December 4, 2023\",\"author\":\"JoomlArt\",\"copyright\":\"Copyright (C) 2005 JoomlArt.com\",\"authorEmail\":\"admin@joomla.org\",\"authorUrl\":\"www.joomlart.com\",\"version\":\"1.0.2\",\"description\":\"\\n\\t\\t\\t<div class=\\\"tpl-info\\\">\\n\\t\\t\\t\\t<h2>JA Social Sharing<\\/h2>\\n\\t\\t\\t\\t<p>The innovative plugin designed to empower users like you with the ability to effortlessly integrate social share buttons into your website. <\\/p>\\n\\t\\t\\t\\t<p><strong>Features:<\\/strong><\\/p>\\n\\t\\t\\t\\t<ul>\\n\\t\\t\\t\\t\\t<li>Support multiple popular social channel<\\/li>\\n\\t\\t\\t\\t\\t<li>Customizable button styles<\\/li>\\n\\t\\t\\t\\t\\t<li>Sharing count<\\/li>\\n\\t\\t\\t\\t\\t<li>Short code to show the social share on the pages, position you want<\\/li>\\n\\t\\t\\t\\t\\t<li>Simple configuration<\\/li>\\n\\t\\t\\t\\t<\\/ul>\\n\\t\\t\\t\\t<p><strong>Supported shortcode<\\/strong><\\/p>\\n\\t\\t\\t\\t<p><code>&lt;div class=&quot;ja-share-button&quot; services=&quot;facebook,messenger,linkedin,tumblr,whatsapp,twitter,reddit,telegram,line,livejournal,flipboard,instapaper,getpocket,hackernew,kooapp,yahoo,email&quot; layout=&quot;default&quot; &gt;&lt;\\/div&gt;<\\/code><\\/p>\\n\\t\\t\\t\\t<p><b>Shortcode Params<\\/b><\\/p>\\n\\t\\t\\t\\t<p>- <code>services<\\/code> pick one or more <code>facebook,messenger,linkedin,tumblr,whatsapp,twitter,reddit,telegram,line,livejournal,flipboard,instapaper,getpocket,hackernew,kooapp,yahoo,email<\\/code><\\/p>\\n\\t\\t\\t\\t<p>- <code>layout<\\/code> is one of layouts from plugin System - JA Social Share<\\/p>\\n\\t\\t\\t\\t<p>- <code>showcount<\\/code> is <code>0<\\/code> or <code>1<\\/code><\\/p>\\n\\t\\t\\t\\t<p>- <code>showtext<\\/code> is <code>0<\\/code> or <code>1<\\/code><\\/p>\\n\\t\\t\\t\\t<p>- <code>buttonsize<\\/code> pick one of <code>small, medium, large, extra<\\/code><\\/p>\\n\\t\\t\\t\\t<p>- <code>buttonstyle<\\/code> pick one of <code>outline-square, outline-rounded, outline-circle, square, rounded, circle<\\/code><\\/p>\\n\\t\\t\\t<\\/div>\\n\\t\\t\",\"group\":\"\",\"filename\":\"jasocialshare\"}','{\"show_count\":\"0\",\"show_service_text\":\"0\",\"button_size\":\"medium\",\"button_style\":\"circle\",\"excluded_elements\":\"\",\"fb_app_id\":\"\"}','',NULL,NULL,0,0,''),(236,0,'plg_system_t4','plugin','t4','','system',0,1,1,0,0,'{\"name\":\"plg_system_t4\",\"type\":\"plugin\",\"creationDate\":\"Mar 8th, 2024\",\"author\":\"JoomlArt\",\"copyright\":\"Copyright (C) 2005 - 2022 JoomlArt.com\",\"authorEmail\":\"admin@joomlart.com\",\"authorUrl\":\"www.joomlart.com\",\"version\":\"2.3.9\",\"description\":\"\\n\\t\\t\\t<div class=\\\"tpl-info\\\">\\n\\t\\t\\t\\t<h2>T4 Framework for Joomla 3, Joomla 4 and Joomla 5<\\/h2>\\n\\t\